.sr-only {
    position: absolute;
    width: 1px;
    height: 1px;
    padding: 0;
    margin: -1px;
    overflow: hidden;
    clip: rect(0, 0, 0, 0);
    border: 0
}

.sr-only-focusable:active,
.sr-only-focusable:focus {
    position: static;
    width: auto;
    height: auto;
    margin: 0;
    overflow: visible;
    clip: auto
}

* {
    scrollbar-width: thin
}

::-webkit-scrollbar {
    width: 6px;
    height: 170px
}

::-webkit-scrollbar-track {
    -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, .3);
    border-radius: 2px
}

::-webkit-scrollbar-thumb {
    border-radius: 2px;
    background: #e7e7e7;
    -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, .5)
